import React, { Component } from 'react';
import {ReactComponent as Logo} from '../assets/neuLogo.svg';
import './Navbar.css';

class Navbar extends Component{
    state={clicked:false};

    handleClick=()=>{
        this.setState({clicked:!this.state.clicked})
    }
    render(){
        return(
            <>
             <nav>
                <div>
                <div className="logo">
                    <Logo style={{width:'50px', height:'50px'}}/>
                </div>
                    <ul id="navbar" className={this.state.clicked ? 'navbar active' : 'navbar'}>
                        <li><a className="activeHome" href="index.html">Home</a></li>
                        <li><a href="index.html">Edit Information</a></li>
                        <li><a href="index.html">Upload Requirements</a></li>
                        <li><a href="index.html">Endorsement Letter</a></li>
                    </ul>
                </div>
    
                <div id="mobile" onClick={this.handleClick}>
                    <i id="bar" className={this.state.clicked ? 'fas fa-times' : 'fas fa-bars'}></i>
                </div>
            </nav>
            </>
        )
    }

}

export default Navbar;
